import '.././style/App.css';
import React, {Component} from 'react';

var Movies = React.createClass({
  render: function(){
    var hobbies = this.props.entries.map(function(hobby, index){
        return (<li key={index}>{hobby}</li>);
    });
    return (
        <div>
            <h5>My hobbies:</h5>
            <ul>
                {hobbies}
            </ul>
        </div>
    );
  }
});

export default Movies;
